window.onload = function () {
    //<editor-fold desc="Changeable Configuration Block">

    function TokenAuthorizationConfigPlugin(system) {
        let tokenInputRef = null
        return {
            wrapComponents: {
                BaseLayout: function (Original) {
                    return function (props) {
                        const urls = system.getConfigs().urls || []
                        if (urls.length > 0) {
                            return system.React.createElement(Original, props)
                        } else {
                            return null
                        }
                    }
                }, InfoUrl: function (Original) {
                    return function (props) {
                        if (props.url) {
                            delete props.url
                        }
                        return system.React.createElement(Original, props)
                    }
                }, Topbar: function (OriginalTopbar) {
                    const downloadSpec = (fetchedConfig) => {
                        const localConfig = system.getConfigs()
                        let mergedConfig = {...localConfig, ...(fetchedConfig || {})}
                        if (Array.isArray(mergedConfig.urls)) {
                            mergedConfig.urls = mergedConfig.urls.map(({url, ...rest}) => ({
                                url: new URL(url, document.baseURI).toString(), ...rest,
                            }))
                        }
                        SwaggerUIBundle(mergedConfig)
                    }
                    const logo = system.React.createElement('img', {
                        src: 'data:image/png;base64,',
                        style: {
                            "width": "300px", "max-width": "300px", "margin-bottom": "10px", "border-radius": "25px"
                        }
                    })
                    const tokenInput = system.React.createElement('input', {
                        type: 'text', ref: ref => tokenInputRef = ref, style: {
                            "height": "30px",
                            "width": "300px",
                            "max-width": "300px",
                            "margin-top": "0",
                            "margin-bottom": "10px",
                            "font-size": "13px"
                        },
                        placeholder: 'Token here'
                    })
                    const button = system.React.createElement(system.getComponent('Button'), {
                        className: 'btn unlocked', style: {
                            "height": "30px", "width": "300px", "max-width": "300px"
                        }, onClick: () => {
                            window.sessionStorage.setItem('token', tokenInputRef.value)
                            system.specActions.getConfigByUrl({
                                url: system.getConfigs().configUrl, loadRemoteConfig: true,
                            }, downloadSpec)
                        }
                    }, 'Insert Token')

                    return function (props) {
                        const urls = system.getConfigs().urls || []
                        if (urls.length > 0) {
                            return system.React.createElement(OriginalTopbar, props)
                        } else {
                            // if not, require authentication
                            return system.React.createElement('div', {
                                className: "topbar-wrap", style: {
                                    position: "fixed", top: 0, left: 0, bottom: 0, right: 0, "font-size": "0"
                                }
                            }, system.React.createElement('div', {
                                className: 'authorization-wrap', style: {
                                    display: "inline-block",
                                    "margin-left": "50%",
                                    height: "380px",
                                    width: "300px",
                                    transform: "translate(-50%, 50%)",
                                }
                            }, logo, tokenInput, button));
                        }
                    }
                }
            }
        }
    }


    // the following lines will be replaced by docker/configurator, when it runs in a docker-container
    window.ui = SwaggerUIBundle({
        dom_id: '#swagger-ui',
        deepLinking: true,
        presets: [SwaggerUIBundle.presets.apis, SwaggerUIStandalonePreset],
        plugins: [SwaggerUIBundle.plugins.DownloadUrl, TokenAuthorizationConfigPlugin],
        layout: "StandaloneLayout",
        configUrl: "/v3/api-docs/swagger-config",
        requestInterceptor: (r) => {
            const token = window.sessionStorage.getItem('token')
            if (token && !r.headers['x-partner-key']) {
                r.headers['x-partner-key'] = token
            }
            return r;
        }
    });

    //</editor-fold>
};
